import { Button, Collapse } from "reactstrap";
import DaySlot from './DaySlot'

const Stadium = () => {
  
    function myDate() {
        var a = new Date();
        var days = new Array(7);
        days[0] = "Sunday";
        days[1] = "Monday";
        days[2] = "Tuesday";
        days[3] = "Wednesday";
        days[4] = "Thursday";
        days[5] = "Friday";
        days[6] = "Saturday";
        var r = days[a.getDay()];
  }
  return (
    <div>
      <h1 style={{marginTop:'3rem',marginBottom:'2rem'}}>Stadium Name</h1>
      <img src="defaultStadium.jpg"></img>
      <h3>Governorate</h3>
      <h4>City</h4>
      <hr/>
      <h2>Day Slots</h2>
      {Array(7)
        .fill(null)
        .map((el, i) => (
          <DaySlot key={i} myDay={myDate}/>
        ))}
    </div>
  );
};

export default Stadium;
